<template>
	<view class="money-view" :style="{background: info.money_background ? `url(${baseUrl + '/' + info.money_background})` : ''}">
		<view class="money-body">
			<view class="money-body-top">
				<view @click="changeChargeType" v-if="switchType === 'personal'" class="top-switch">
					<image src="https://eden-life.net.cn:9000/cdn/mango/images/home/个人.png"></image>
					<view class="text">
						<image src="https://eden-life.net.cn:9000/cdn/mango/images/home/切换.png"></image>个人记账
					</view>
				</view>
				<view @click="changeChargeType" v-else class="top-switch">
					<image src="https://eden-life.net.cn:9000/cdn/mango/images/home/团队.png"></image>
					<view class="text">
						<image src="https://eden-life.net.cn:9000/cdn/mango/images/home/切换.png">团队/家庭记账
					</view>
				</view>
				<u-subsection :list="titleList" activeColor="#ffbb00" inactiveColor="#333" mode="subsection"
					@change="sectionChange" bgColor="#ffbb00" :current="curNow">
				</u-subsection>
				<u-button @click="handleShowAnalysis" type="primary" size="mini" color="#ffbb00" text="统计"
					:customStyle="buttonStyle" icon="grid-fill" iconColor="#333"></u-button>
			</view>
			
			<view class="money-swiper">
				<view v-if="switchType === 'personal'" class="money-swiper-in">
					<view v-if="swiperCurrent === 0" class="money-swiper-in-in">
						<view class="money-body-icons">
							<view class="money-body-icon" v-for="(u,index) in iconsListSpendPersonal" :key="u.id"
								@click="handleShowCalendar(u)">
								<image :src="u.src"></image>
								<text>{{ u.name + '\n' + u.money }}</text>
							</view>
							<view class="money-body-icon icon-manage" @click="handleShowManage">
								<image src="https://eden-life.net.cn:9000/cdn/mango/images/home/其他.png"></image>
								<text>{{ '管理' + '\n\n' }}</text>
							</view>
						</view>
					</view>
					<view v-else class="money-swiper-in-in">
						<view class="money-body-icons">
							<view class="money-body-icon" v-for="(u,index) in iconsListIncomePersonal" :key="u.id"
								@click="handleShowCalendar(u)">
								<image :src="u.src"></image>
								<text>{{ u.name + '\n' + u.money }}</text>
							</view>
							<view class="money-body-icon icon-manage" @click="handleShowManage">
								<image src="https://eden-life.net.cn:9000/cdn/mango/images/home/其他.png"></image>
								<text>{{ '管理' + '\n\n' }}</text>
							</view>
						</view>
					</view>
				</view>
				<view v-if="switchType === 'team'" class="money-swiper-in">
					<view v-if="swiperCurrent === 0" class="money-swiper-in-in">
						<view class="money-body-icons">
							<view class="money-body-icon" v-for="(u,index) in iconsListSpendTeam" :key="u.id"
								@click="handleShowCalendar(u)">
								<image :src="u.src"></image>
								<text>{{ u.name + '\n' + u.money }}</text>
							</view>
							<view class="money-body-icon icon-manage" @click="handleShowManage">
								<image src="https://eden-life.net.cn:9000/cdn/mango/images/home/其他.png"></image>
								<text>{{ '管理' + '\n\n' }}</text>
							</view>
						</view>
					</view>
					<view v-else class="money-swiper-in-in">
						<view class="money-body-icons">
							<view class="money-body-icon" v-for="(u,index) in iconsListIncomeTeam" :key="u.id"
								@click="handleShowCalendar(u)">
								<image :src="u.src"></image>
								<text>{{ u.name + '\n' + u.money }}</text>
							</view>
							<view class="money-body-icon icon-manage" @click="handleShowManage">
								<image src="https://eden-life.net.cn:9000/cdn/mango/images/home/其他.png"></image>
								<text>{{ '管理' + '\n\n' }}</text>
							</view>
						</view>
					</view>
				</view>
			</view>

			

			<view class="money-body-bottom">
				<image v-if="info.money_avatar" :src="baseUrl + '/' + info.money_avatar" @click="showView"></image>
				<image v-else src="../../static/lanbidan.png"></image>
				<view class="today" v-if="switchType==='personal'">
					<text>今日总<text>{{ curNow===0 ? '支出\n' : '收入\n' }}</text><text
							style="color: #ffbb00">{{ !showSwitch ? '***' : curNow === 0 ? todayTotalPersonal.spend : todayTotalPersonal.income }}</text></text>
					<u-switch style="margin-top: 20rpx;" v-model="showSwitch" size="20" activeColor="#ffbb00">
					</u-switch>
				</view>
				<view class="today" v-else>
					<text>今日总<text>{{ curNow===0 ? '支出\n' : '收入\n' }}</text><text
							style="color: #ffbb00">{{ !showSwitch ? '***' : curNow === 0 ? todayTotalTeam.spend : todayTotalTeam.income }}</text></text>
					<u-switch style="margin-top: 20rpx;" v-model="showSwitch" size="20" activeColor="#ffbb00">
					</u-switch>
				</view>
			</view>
		</view>
		<!-- <CalendarWrapper @ok="handleOkCalendar" :switchType="switchType" :userInfo="userInfo" ref="CalendarWrapper">
		</CalendarWrapper> -->
		<!-- <AnalysisWrapper ref="AnalysisWrapper" :iconsList="iconsList" :userInfo="userInfo"></AnalysisWrapper> -->
		<!-- <ManageTypesWrapper @ok="handleOkManage" :userInfo="userInfo" :iconsListIncomePersonal="iconsListIncomePersonal"
			:iconsListIncomeTeam="iconsListIncomeTeam" :iconsListSpendPersonal="iconsListSpendPersonal"
			:iconsListSpendTeam="iconsListSpendTeam" ref="ManageTypesWrapper"></ManageTypesWrapper> -->
		<u-modal zIndex="1000" :overlayStyle="{zIndex: 900}" :show="showModal" @confirm="showModal=false" confirmColor="#ffbb00"
			content="您暂未拥有团队或家庭，无法切换至团队/家庭记账模式。请在个人中心创建或由其他成员邀请后使用。"></u-modal>
		<u-overlay zIndex="100" :show="showOverlay">
			<view class="warp" @tap.stop>
				<text>您还未登录，请前往登录</text>
				<u-button
					:customStyle="{width: '180rpx', background: 'transparent', height: '60rpx', marginTop: '40rpx'}"
					:plain="true" color="#ffbb00" type="primary" text="前往登录" @click="handleGotoLogin"></u-button>
			</view>
		</u-overlay>
	</view>
</template>

<script>
	import Vue from 'vue';
	import {
		getUserInfoByUsernameAction,
		getDatePersonalChargeAction,
		getDateTeamChargeAction,
		getPersonalChargeTypesAction,
		getTeamChargeTypesAction,
		getInfoByUserIdAction
	} from '@/service/service'
	import moment from 'moment';
	export default Vue.extend({
		data() {
			return {
				baseUrl: process.env.VUE_APP_API_BASE_URL,
				info: {
					id: 0,
					money_avatar: '',
					money_background: '',
					user_id: 0
				},
				switchType: 'personal',
				showModal: false,
				showOverlay: false,
				swiperCurrent: 0,
				todaySpendMoney: 0,
				todayIncomeMoney: 0,
				showSwitch: false,
				titleList: ['支出', '收入'],
				curNow: 0,
				buttonStyle: {
					height: '42rpx',
					width: '50rpx',
					position: 'absolute',
					bottom: '26rpx',
					right: '26rpx',
					color: '#333',
					fontSize: '12px !important'
				},
				iconsListIncomePersonal: require('@/static/json/default_icons.json').iconsListIncome.map((item) => {
					return {
						...item,
						src: `https://eden-life.net.cn:9000/cdn/mango/images/home/${item.icon}`,
						money: 0
					}
				}),
				iconsListIncomeTeam: require('@/static/json/default_icons.json').iconsListIncome.map((item) => {
					return {
						...item,
						src: `https://eden-life.net.cn:9000/cdn/mango/images/home/${item.icon}`,
						money: 0,
						created_type: 'default'
					}
				}),
				iconsListSpendPersonal: require('@/static/json/default_icons.json').iconsListSpend.map((item) => {
					return {
						...item,
						src: `https://eden-life.net.cn:9000/cdn/mango/images/home/${item.icon}`,
						money: 0,
						created_type: 'default'
					}
				}),
				iconsListSpendTeam: require('@/static/json/default_icons.json').iconsListSpend.map((item) => {
					return {
						...item,
						src: `https://eden-life.net.cn:9000/cdn/mango/images/home/${item.icon}`,
						money: 0,
						created_type: 'default'
					}
				}),
				userInfo: {
					username: '',
					nickname: '',
					primary_key: '',
					id: 0,
					email: '',
					phone: '',
					avatar: '',
					team_id: 0,
					team_name: ''
				},
				todayListPersonal: [],
				todayTotalPersonal: {
					spend: 0,
					income: 0
				},
				todayListTeam: [],
				todayTotalTeam: {
					spend: 0,
					income: 0
				}
			};
		},
		computed: {
			iconsList(){
				if(this.switchType === 'personal'){
					return this.curNow === 0 ? this.iconsListSpendPersonal : this.iconsListIncomePersonal
				}else{
					return this.curNow === 0 ? this.iconsListSpendTeam : this.iconsListIncomeTeam
				}
			}
		},
		watch: {
			userInfo: {
				handler() {
					this.showOverlay = !this.userInfo.id
					if (this.userInfo.id) {
						console.log('this.userInfo.id', this.userInfo.id)
						getInfoByUserIdAction(this.userInfo).then(res=>{
							this.info = res.data
							uni.setStorageSync('SYS_INFO_INFO',res.data)
						})
					}else{
						uni.removeStorageSync('SYS_INFO_INFO')
						this.info = {
							id: 0,
							money_avatar: '',
							money_background: '',
							user_id: 0
						}
					}
				},
				deep: true
			},
			switchType: {
				handler() {
					console.log('switchType change', this.switchType)
					this.getPersonalTypes()
					if(this.userInfo.team_id){
						this.getTeamTypes()
					}
				}
			},
			iconsListSpendPersonal: {
				handler() {
					console.log('iconsListSpendPersonal change', this.iconsListSpendPersonal)
				},
				deep: true
			},
			showSwitch: {
				handler(){
					uni.setStorageSync('SYS_INFO_SHOW_SWITCH',this.showSwitch)
				}
			}
		},
		onShow() {
			if(uni.getStorageSync('SYS_INFO_INFO')){
				this.info = uni.getStorageSync('SYS_INFO_INFO')
			}
			const switchHistory = uni.getStorageSync('SYS_SWITCH_TYPE')
			if (switchHistory && switchHistory === 'personal' || switchHistory === 'team') {
				this.switchType = switchHistory
			}
			this.showSwitch = !!uni.getStorageSync('SYS_INFO_SHOW_SWITCH') || false
			if (uni.getStorageSync('SYS_USER_INFO') && uni.getStorageSync('SYS_USER_INFO').id) {
				this.userInfo = uni.getStorageSync('SYS_USER_INFO')
				console.log('this.userInfo', this.userInfo)
				this.getUserInfo(this.userInfo)
			} else {
				this.userInfo = {
					username: '1',
					nickname: '',
					primary_key: '',
					id: 0,
					email: '',
					phone: '',
					avatar: '',
					team_id: 0,
					team_name: ''
				}
				uni.removeStorageSync('SYS_SWITCH_TYPE')
				uni.removeStorageSync('SYS_INFO_SHOW_SWITCH')
				this.loadDefaultIcons()
			}
		},
		methods: {
			showView(){
				// 预览图片
				uni.previewImage({
					urls: [this.baseUrl + '/' + this.info.money_avatar],
					indicator: 'none'
				});
			},
			loadDefaultIcons() {
				this.iconsListIncomePersonal = require('@/static/json/default_icons.json').iconsListIncome.map((item) => {
					return {
						...item,
						src: `https://eden-life.net.cn:9000/cdn/mango/images/home/${item.icon}`,
						money: 0,
						created_type: 'default'
					}
				})
				this.iconsListIncomeTeam = JSON.parse(JSON.stringify(this.iconsListIncomePersonal))
				this.iconsListSpendPersonal = require('@/static/json/default_icons.json').iconsListSpend.map((item) => {
					return {
						...item,
						src: `https://eden-life.net.cn:9000/cdn/mango/images/home/${item.icon}`,
						money: 0,
						created_type: 'default'
					}
				})
				this.iconsListSpendTeam = JSON.parse(JSON.stringify(this.iconsListSpendPersonal))
			},
			handleOkCalendar() {
				this.getPersonalTypes()
				if(this.userInfo.team_id){
					this.getTeamTypes()
				}
			},
			handleOkManage(){
				this.getPersonalTypes()
				if(this.userInfo.team_id){
					this.getTeamTypes()
				}
			},
			handleGotoLogin() {
				console.log('handleGotoLogin')
				uni.switchTab({
					url: "/pages/mine/Mine"
				})
			},
			getPersonalTypes() {
				this.$loadingOn();
				getPersonalChargeTypesAction({
					balance_type: this.curNow,
					created_by: this.userInfo.id
				}).then(res => {
					this.curNow === 1 ? this.iconsListIncomePersonal = res.data.map((item) => {
						return {
							origin_id: item.id,
							id: item.realname,
							name: item.name,
							src: `https://eden-life.net.cn:9000/cdn/mango/images/home/${item.icon}`,
							money: 0,
							created_type: item.created_type,
							icon: item.icon
						}
					}) : this.iconsListSpendPersonal = res.data.map((item) => {
						return {
							origin_id: item.id,
							id: item.realname,
							name: item.name,
							src: `https://eden-life.net.cn:9000/cdn/mango/images/home/${item.icon}`,
							money: 0,
							created_type: item.created_type,
							icon: item.icon
						}
					})
					
					setTimeout(() => {
						this.getTodayPersonalInfo()
					},200)
				}).catch(err=>{
					this.$loadingOff();
				})
			},
			getTeamTypes() {
				this.$loadingOn();
				getTeamChargeTypesAction({
					balance_type: this.curNow,
					team_id: this.userInfo.team_id
				}).then(res => {
					this.curNow ? this.iconsListIncomeTeam = res.data.map((item) => {
						return {
							origin_id: item.id,
							id: item.realname,
							name: item.name,
							src: `https://eden-life.net.cn:9000/cdn/mango/images/home/${item.icon}`,
							money: 0,
							created_type: item.created_type,
							icon: item.icon
						}
					}) : this.iconsListSpendTeam = res.data.map((item) => {
						return {
							origin_id: item.id,
							id: item.realname,
							name: item.name,
							src: `https://eden-life.net.cn:9000/cdn/mango/images/home/${item.icon}`,
							money: 0,
							created_type: item.created_type,
							icon: item.icon
						}
					})
					
					setTimeout(() => {
						this.getTodayTeamInfo()
					},100)
				}).catch(err=>{
					this.$loadingOff();
				})
			},
			getTodayPersonalInfo() {
				getDatePersonalChargeAction({
					charge_time: moment(new Date(), 'YYYY-MM-DD').format('YYYY-MM-DD') + ' 00:00:00',
					created_by: this.userInfo.id
				}).then(res1 => {
					this.todayListPersonal = res1.data.summary.items
					this.todayTotalPersonal = res1.data.summary.total
					this.iconsListSpendPersonal.forEach((item) => {
						const itemFind = this.todayListPersonal.find((itemIn) => itemIn.charge_type === item.id)
						if (itemFind) {
							console.log('itemFind find-------------', itemFind)
							this.$set(item, 'money', Math.round(itemFind.money * 100) / 100)
							//item.money = itemFind.money
						}
					})
					this.iconsListIncomePersonal.forEach((item) => {
						const itemFind = this.todayListPersonal.find((itemIn) => itemIn.charge_type === item.id)
						if (itemFind) {
							console.log('itemFind find-------------', itemFind)
							// @ts-ignore
							this.$set(item, 'money', Math.round(itemFind.money * 100) / 100)
						}
					})
					this.$loadingOff();
				}).catch(err=>{
					this.$loadingOff();
				})
			},
			getTodayTeamInfo() {
				getDateTeamChargeAction({
					charge_time: moment(new Date(), 'YYYY-MM-DD').format('YYYY-MM-DD') + ' 00:00:00',
					team_id: this.userInfo.team_id
				}).then(res1 => {
					this.todayListTeam = res1.data.summary.items
					this.todayTotalTeam = res1.data.summary.total
					this.iconsListSpendTeam.forEach((item) => {
						const itemFind = this.todayListTeam.find((itemIn) => itemIn.charge_type === item.id)
						if (itemFind) {
							console.log('itemFind find-------------', itemFind)
							this.$set(item, 'money', Math.round(itemFind.money * 100) / 100)
						}
					})
					this.iconsListIncomeTeam.forEach((item) => {
						const itemFind = this.todayListTeam.find((itemIn) => itemIn.charge_type === item.id)
						if (itemFind) {
							console.log('itemFind find-------------', itemFind)
							this.$set(item, 'money', Math.round(itemFind.money * 100) / 100)
						}
					})
					this.$loadingOff();
				}).catch(err=>{
					this.$loadingOff();
				})
			},
			getUserInfo(userInfo) {
				return new Promise((reslove, reject) => {
					getUserInfoByUsernameAction(userInfo).then(res => {
						//this.close()
						uni.setStorageSync('SYS_USER_INFO', res.data)
						this.getPersonalTypes()
						if(this.userInfo.team_id){
							this.getTeamTypes()
						}
						this.userInfo = res.data
						reslove()
					}).catch(() => {
						this.userInfo = {
							username: '',
							nickname: '',
							primary_key: '',
							id: 0,
							email: '',
							phone: '',
							avatar: '',
							team_id: 0,
							team_name: ''
						}
						uni.removeStorageSync('SYS_USER_INFO')
						reject()
					})
				})
			},
			changeChargeType() {
				switch (this.switchType) {
					case 'personal': {
						if (!this.userInfo.team_id) {
							this.showModal = true;
						} else {
							this.switchType = 'team'
						}
						break;
					};
				case 'team': {
					this.switchType = 'personal'
					break;
				};
				}
				uni.setStorageSync('SYS_SWITCH_TYPE', this.switchType)
			},
			handleShowAnalysis() {
				const that = this
				uni.navigateTo({
					url: "/pages-money/analysis",
					success: function(res) {
					    // 通过eventChannel向被打开页面传送数据
					    res.eventChannel.emit('show', { switchType: that.switchType, showType: that.curNow === 0 ? 'spend' : 'income', iconsList: that.iconsList, userInfo: that.userInfo })
					}
				})
			},
			handleShowManage(){
				const that = this
				uni.navigateTo({
					url: "/pages-money/manage-types",
					success: function(res) {
					    // 通过eventChannel向被打开页面传送数据
					    res.eventChannel.emit('show', { 
								switchType: that.switchType, 
								showType: that.curNow === 0 ? 'spend' : 'income', 
								userInfo: that.userInfo,
								iconsListIncomePersonal: that.iconsListIncomePersonal,
								iconsListIncomeTeam: that.iconsListIncomeTeam,
								iconsListSpendPersonal: that.iconsListSpendPersonal,
								iconsListSpendTeam: that.iconsListSpendTeam
							},
						)
					}
				})
			},
			swiperChange(evt) {
				this.curNow = evt.detail.current;
				this.swiperCurrent = evt.detail.current;
			},
			sectionChange(index) {
				this.curNow = index;
				this.swiperCurrent = index;
				this.getPersonalTypes()
				if(this.userInfo.team_id){
					this.getTeamTypes()
				}
			},
			handleShowCalendar(record) {
				const that = this
				uni.navigateTo({
					url: "/pages-money/calendar",
					success: function(res) {
					    // 通过eventChannel向被打开页面传送数据
					    res.eventChannel.emit('show', { record, showType: that.curNow === 0 ? 'spend' : 'income', userInfo: that.userInfo, switchType: that.switchType })
					}
				})
			},
			changeSwitch() {
				this.showSwitch = !this.showSwitch
			}
		}
	})
</script>

<style lang="scss">
	.warp {
		display: flex;
		align-items: center;
		justify-content: center;
		height: 100vh;
		flex-direction: column;
		color: #fff;
		font-size: 14px;
	}

	.money-view {
		width: 100vw;
		min-height: 100vh;
		display: flex;
		background: url(data:image/jpg;base64,);
		background-size: 100% 100% !important; 
		background-repeat:no-repeat !important;
	}

	.money-body {
		width: 100vw;
		box-sizing: border-box;
		position: relative;
		
		box-sizing: border-box;
		display: flex;
		flex-direction: column;

		.money-body-top {
			height: 250rpx;
			width: 100%;
			border-bottom: 1px solid #ffbb00;
			position: relative;
			display: flex;
			justify-content: center;
			align-items: center;

			.u-subsection {
				width: 300rpx !important;
				position: absolute;
				left: 50%;
				bottom: 30rpx;
				transform: translateX(-50%);
			}

			.top-switch {
				position: absolute;
				bottom: 10rpx;
				left: 20rpx;
				display: flex;
				align-items: center;
				justify-content: center;
				flex-direction: column;
				transform: scale(0.8);

				>image {
					width: 44rpx;
					height: 44rpx;
					background: #e8e8e8;
					border-radius: 50%;
				}

				.text {
					font-size: 12px;
					color: #333;
					display: flex;
					align-items: center;

					>image {
						width: 24rpx;
						height: 24rpx;
